import "./Navbar.css";
import{Component} from "react";
import { Link} from "react-router-dom";
import { MenuItems } from "./MenuItems";
import React,{} from 'react';



class Navbar extends Component {
    state={clicked:false};
    handleClick=()=>{
        this.setState({clicked:!this.state.clicked})
    }
    render()
    {
       


        
        return(
            <>
        
            <nav className="NavbarItems">
                <h1 className="navbar-logo">SR Tutorials</h1>
                <div className="menu-icons" onClick=
                {this.handleClick
                }>
                    <i className={this.state.clicked?"fas fa-times":
                    "fas fa-bars"}></i>
                    
                 </div>
                <ul className={this.state.clicked?"nav-menu active":"nav-menu"}>
                    {MenuItems.map((item,index)=>{
                        return(
                            <li key={index}>
                            <Link className={item.cName}  to={item.url}>
                            <i className={item.icon}></i> {item.title}
                            </Link>
                        </li>

                         )
                    })}
                    
                </ul>

               

               
                <div class="dropdown">
    <button class="dropbtn">Login
      <i class="fa fa-caret-down"></i>
    </button>
    <div class="dropdown-content">
        
    <Link style={{textDecoration: 'none'}} to="/PTutor">
          <div className="btnabc">Parent/Tutor </div>
          </Link>
    <Link style={{textDecoration: 'none'}} to="/superadmin">
          <div className="btnabc">Super Admin</div>
          </Link>
    <Link style={{textDecoration: 'none'}} to="/branchadmin">
          <div className="btnabc">Branch Admin </div>
          </Link>
         
        
      
    </div>
    </div>
            </nav>


</>
        )
        }
    }


export default Navbar;
